import React from 'react';
import MainApp from '../components/layouts/MainApp'
import Content from '../components/container/Content'

function cart() {
    return (
        <MainApp>
            <Content title="My Cart" >
                <div>
                    <table className={`table table-fixed w-full`} >
                        <tbody>
                            <tr>
                                <td>Adfsf</td>
                            </tr>
                        </tbody>
                    </table>
                </div>

            </Content>
        </MainApp>
    );
}

export default cart;
